import Footer from "../Components/Footer";

export default function DetailMobil() {
    return (
        <>
            <Navbar />
            <div className="container w-100 h-auto mx-auto bg-[#F4F6F5]">
                <h1 className="font-black text-4xl text-left mb-10">
                    DETAIL PENYEWAAN
                </h1>
            </div>
            <Footer />
        </>
    );
}
